import React from 'react';

const Header = (props) => {

    return(
        <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" className={classes.title}>
            {props.title}
          </Typography>
        </Toolbar>
      </AppBar>
    )

}

export default Header;
